// 建造建筑，升级建筑，加速完成
// 1102协议option 说明：
// 1:建造(普通建造，消耗资源，花时间)（资源不够，可以花魔钻替代）
// 2:只花魔钻，不花其他资源，立刻完成，不花时间，不占用队列
// 3:升级（普通升级，消耗资源，花时间）（资源不够，可以花魔钻替代）
// 4:升级立刻完成（不花其他资源，立刻完成，不花时间，不占用队列）
// 5:拆除（返回一半资源，倒计时拆除）（拆除完成后返回资源），没有立刻拆除
// 6:消费魔钻加速建造
// 7:消费魔钻加速升级
// 8:消费道具加速建造
// 9:消费道具加速升级
// 10:消费魔钻加速拆除
// 11:消费道具加速拆除
// 12:取消建造
